import React from 'react';
import { Paper, Grid, Button, CssBaseline, Container, CardContent, CardMedia, Typography } from '@material-ui/core';
import Data from '../data.json'
import './css/Ventas.css'


export default function Ventas() {

    const imgi = (
        <ul>
            {props.posts.map((post) =>
                <li key={post.id}>
                    {post.imgBanner}
                </li>
             )}
        </ul>
    );

    const tittlei= (
        <ul>
            {props.posts.map((post) =>
                <li key={post.id}>
                    {post.tittle}
                </li>
            )}
        </ul>
    );

    const contenti = (
        <ul>
            {props.posts.map((post) =>
                <li key={post.id}>
                    {post.smallContent}
                </li>
            )}
        </ul>
    );



    return (
        <div className='root'>
            <React.Fragment>
                <CssBaseline />
                <Container fixed>
                    <Grid container spacing={3}>
                        <Grid item xs={12}>
                            <Paper className='paper_prim'>
                                <h1>Propiedades en Venta</h1>
                            </Paper>
                        </Grid>

                            return (                              
                                <>
                                    <Grid item xs={4}>
                                        <Paper className='paper_sec'>
                                            <CardMedia
                                                className='media'
                                                image={imgi}
                                                title="Imagen Descripcion"
                                            />
                                            <CardContent>
                                                <Typography gutterBottom variant="h5" component="h2">
                                                    {tittlei}
                                                </Typography>
                                                <Typography variant="body2" color="textSecondary" component="p">
                                                    {contenti}
                                                </Typography>
                                            </CardContent>
                                            <Button variant="contained" color="primary">
                                                Ver Propiedad
                                            </Button>
                                        </Paper>
                                    </Grid>
                                    </>

                            )
                        })}
                    </Grid>
                </Container>
            </React.Fragment>
        </div>
    );
}
